import React from 'react'
import DeleteIcon from '@mui/icons-material/Delete';
export default function Note(props) {

  return (
    <div id = {props.id} className = "notes">
        <h1>{props.title}</h1>
        <button onClick = {() => {props.delNote(props.id)}}></button>
        <p>{props.content}</p>
    </div>
  )
}
